import React, {Component} from 'react';

class Header extends Component {

  state = {
    isVisible: false
  }

  handleClick = () => {
    this.setState(prevState => ({
      isVisible: !prevState.isVisible
    }))
  }

  render() {
    return (
      <div className="row nav-row">
        <header>
          <nav className={this.state.isVisible ? 'expanded' : ''}>
            <div className="col-4"></div>
            <div className="col-4">
              <h1>Ryan K. Collins</h1>
            </div>
            <div id="line-icon" className="col-4">
              <i className="fas fa-bars fa-2x" onClick={this.handleClick}></i>
            </div>

            <div className="col-12">
              <div className="title-underline"></div>
            </div>
            <div className="col flex-row">
              <h6>Web Developer/Musician</h6>
              <div id="navlink-div" style={{display: this.state.isVisible ? 'block': 'none'}} onClick={this.handleClick}>
                <ul>
                  <li>
                    <a href="#about">About</a>
                  </li>
                  <li>
                    <a href="#skills">Skills</a>
                  </li>
                  <li>
                    <a href="#projects">Projects</a>
                  </li>
                </ul>
              </div>
            </div>
          </nav>
        </header>
      </div>
    );
  }

}

export default Header;
